import React from "react";
import { Header, Image } from "semantic-ui-react";

const InlineHeaderImage = props => {
  return (
    <Header>
      {props.text}
      <Image src={props.imageSource} style={props.style ? props.style : null} />
    </Header>
  );
};

export default InlineHeaderImage;
